import{_ as $,c as a,o as d,ag as e}from"./chunks/framework.CPtCmog4.js";const l=JSON.parse('{"title":"概率论与数理统计","description":"","frontmatter":{},"headers":[],"relativePath":"其他/math.md","filePath":"其他/math.md","lastUpdated":null}'),r={name:"其他/math.md"};function p(n,t,h,s,o,i){return d(),a("div",null,t[0]||(t[0]=[e('<p>待解决</p><p>笛卡尔积</p><p>高斯消元</p><h1 id="概率论与数理统计" tabindex="-1">概率论与数理统计 <a class="header-anchor" href="#概率论与数理统计" aria-label="Permalink to &quot;概率论与数理统计&quot;">​</a></h1><h5 id="概念" tabindex="-1">概念 <a class="header-anchor" href="#概念" aria-label="Permalink to &quot;概念&quot;">​</a></h5><p>确定性事件：一定（不）发生</p><p>随机事件：可能发生，可能不发生 (随机事件的特点：结果相同条件下可重现；结果不止一个；结果无法预测)</p><p>基本事件：相对于实验目的来说不可再分的事件</p><p>复合事件：由基本事件复合而成</p><p>必然事件：一定发生 符号为 $$\\Omega$$</p><p>不可能事件：一定不发生 符号为 $$\\emptyset $$</p><p>互补相容事件：A，B不同时发生 $$A\\cap B = \\emptyset$$</p><p>对立事件：A、B互不相容且 $$A\\cup B = \\Omega$$</p><p>完备事件：$$A_1 A_2 A_3 ... A_n = \\Omega$$</p><p>样本空间：所有基本事件的集合</p><p>样本点：样本空间的元素</p><p>​ 例：向量空间：$$\\Omega = {(x,y,z) | x,y,z \\in R}$$</p><h5 id="集合间的关系" tabindex="-1">集合间的关系 <a class="header-anchor" href="#集合间的关系" aria-label="Permalink to &quot;集合间的关系&quot;">​</a></h5><table tabindex="0"><thead><tr><th>符号</th><th>解释</th></tr></thead><tbody><tr><td>$$A^{-1}$$</td><td>A的逆；</td></tr><tr><td>$$A \\subset B$$</td><td>A 包含于 B；A发生必然导致B发生</td></tr><tr><td>$$B \\supset A$$</td><td>B 包含 A；</td></tr><tr><td>$$A = B$$</td><td>A 等于 B;</td></tr><tr><td>$$A \\cup B$$</td><td>A 并 B; 也可写成 A+B $$A+A=A$$ $$ A\\subset A+B$$ $$A + \\Omega = \\Omega$$ $$A + \\emptyset = A$$</td></tr><tr><td>$$A \\cap B$$</td><td>A 交 B; 也可写成 AB $$AA=A$$ $$ AB\\subset A$$ $$A\\Omega = A$$ $$A\\emptyset = \\emptyset$$</td></tr><tr><td>$$A \\setminus B$$</td><td>A 减 B；也可写作A-B $$A-B = A - AB$$</td></tr></tbody></table><h5 id="集合运算律" tabindex="-1">集合运算律 <a class="header-anchor" href="#集合运算律" aria-label="Permalink to &quot;集合运算律&quot;">​</a></h5><p>交换律：</p><p>$$A\\cap B = B\\cap A$$ $$A\\cup B = B\\cup A$$</p><p>结合律</p><p>分配律</p><h5 id="数学中的一些集合" tabindex="-1">数学中的一些集合 <a class="header-anchor" href="#数学中的一些集合" aria-label="Permalink to &quot;数学中的一些集合&quot;">​</a></h5><table tabindex="0"><thead><tr><th>名称</th><th>符号表示</th><th>定义</th><th>例</th></tr></thead><tbody><tr><td>复数</td><td>$$\\mathbb{C}$$</td><td>所有实数和虚数</td><td>$$0,1,-\\pi,1+i...$$</td></tr><tr><td>实数</td><td>$$\\mathbb{R}$$</td><td>所有有理数和无理数</td><td></td></tr><tr><td>有理数</td><td>$$\\mathbb{Q}$$</td><td>所有可以用两个整数比表示的数，即所有分数</td><td>$$\\frac{0}{1},\\frac{1}{1},\\frac{1}{2},\\frac{2}{1},\\frac{99}{42} ...$$</td></tr><tr><td>无理数</td><td>$$\\mathbb{R}\\setminus\\mathbb{Q}$$</td><td>无法用两个整数比表示的数，即无限不循环小数</td><td>$$ e, \\pi,\\sqrt{2} ...$$</td></tr><tr><td>整数</td><td>$$\\mathbb{Z}$$</td><td>负整数、0、正整数</td><td>$$... -3,-2,-1,0,1,2,3 ...$$</td></tr><tr><td>自然数</td><td>$$\\mathbb{N}$$</td><td>0和正整数。(ps: 包含0存在争议，包含0记作$$N_0$$$$N$$ 不包含记作$$N*$$ $$N_1$$)</td><td>$$0,1,2,3,4 ...$$</td></tr></tbody></table><h5 id="等差数列" tabindex="-1">等差数列 <a class="header-anchor" href="#等差数列" aria-label="Permalink to &quot;等差数列&quot;">​</a></h5><p>数列中每一项与其前一项之间的差值相同的数列，称之为等差数列（1 2 3 4 5 6 7 ... n）。每项与其前一项之间的差值称之为<strong>公差</strong> ，用字母 <strong>d</strong> 表示。</p><p>第n项: $$a_n = a + (n-1) \\times d$$</p><p>求和公式: $$S_n = \\frac{n}{2} \\times (2a + (n-1)\\times d)$$</p><p>​ 其中，a为第一项，d为公差，n为所求项在数列中的项数）。</p><p>​ 注意：求和公式即计算矩形面积公式的宽*高： （n/ 2）*（第一项 + 最后一项）</p><h5 id="等比数列" tabindex="-1">等比数列 <a class="header-anchor" href="#等比数列" aria-label="Permalink to &quot;等比数列&quot;">​</a></h5><p>数列中每一项与其前一项之间的比值相同的数列，称之为等比数列（如：1 2 4 8... 2^(n-1)）。每项与其前一项之间的比值称之为<strong>公比</strong>，用字母 <strong>r</strong> 表示。</p><p>第n项 $$ a_n = a \\times r^{(n-1)} $$ 求和公式 $$ S_n = a \\times \\frac{1-r^n}{1-r} $$</p><h4 id="" tabindex="-1"><a class="header-anchor" href="#" aria-label="Permalink to &quot;&quot;">​</a></h4>',36)]))}const m=$(r,[["render",p]]);export{l as __pageData,m as default};
